import { useState } from 'react';
import { motion } from 'framer-motion';
import axios from 'axios';

const SupportPage = () => {
  const [name, setName] = useState('');
  const [email, setEmail] = useState('');
  const [message, setMessage] = useState('');
  const [success, setSuccess] = useState('');
  const [error, setError] = useState('');

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      await axios.post('/api/support', { name, email, message }); // Replace with your API
      setSuccess('Your message has been sent successfully!');
      setError('');
      setName('');
      setEmail('');
      setMessage('');
    } catch (err) {
      setError('Failed to send message. Please try again.');
      setSuccess('');
    }
  };

  return (
    <div className="bg-white px-4 md:px-6 py-16 md:py-20 space-y-16 md:space-y-20">
      {/* Hero Section */}
      <motion.section
        initial={{ opacity: 0, y: -50 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.8 }}
        className="text-center py-12 md:py-16 bg-gradient-to-r from-blue-600 to-blue-400 rounded-2xl md:rounded-3xl shadow-2xl text-white"
      >
        <h1 className="text-4xl md:text-5xl font-extrabold mb-4 md:mb-6">
          Need Help? Contact Support
        </h1>
        <p className="text-lg md:text-xl max-w-2xl mx-auto">
          We’re here to help. Fill out the form below or check our FAQs for quick answers.
        </p>
      </motion.section>

      {/* Contact Form */}
      <section className="max-w-3xl mx-auto bg-blue-50 rounded-2xl md:rounded-3xl shadow-inner p-8 md:p-12">
        <h2 className="text-2xl md:text-3xl font-bold text-primary mb-6 text-center">
          Send Us a Message
        </h2>
        {success && <p className="text-green-600 text-center mb-4">{success}</p>}
        {error && <p className="text-red-600 text-center mb-4">{error}</p>}
        <form onSubmit={handleSubmit} className="space-y-4">
          <input
            type="text"
            placeholder="Your Name"
            value={name}
            onChange={(e) => setName(e.target.value)}
            className="w-full p-3 md:p-4 border border-gray-300 rounded-full shadow-sm focus:outline-none focus:ring-2 focus:ring-primary transition"
            required
          />
          <input
            type="email"
            placeholder="Your Email"
            value={email}
            onChange={(e) => setEmail(e.target.value)}
            className="w-full p-3 md:p-4 border border-gray-300 rounded-full shadow-sm focus:outline-none focus:ring-2 focus:ring-primary transition"
            required
          />
          <textarea
            placeholder="Your Message"
            value={message}
            onChange={(e) => setMessage(e.target.value)}
            className="w-full p-3 md:p-4 border border-gray-300 rounded-2xl shadow-sm focus:outline-none focus:ring-2 focus:ring-primary transition resize-none h-32 md:h-40"
            required
          />
          <button
            type="submit"
            className="w-full bg-secondary text-white px-6 md:px-8 py-3 md:py-4 rounded-full font-semibold shadow-md hover:bg-green-700 transition"
          >
            Send Message
          </button>
        </form>
      </section>

      {/* FAQ Section */}
      <section className="max-w-4xl mx-auto space-y-6">
        <h2 className="text-2xl md:text-3xl font-bold text-primary text-center mb-6">
          Frequently Asked Questions
        </h2>
        <motion.div
          initial={{ opacity: 0 }}
          animate={{ opacity: 1 }}
          transition={{ duration: 0.8 }}
          className="space-y-4"
        >
          <details className="bg-blue-50 rounded-2xl p-4 shadow-inner">
            <summary className="font-semibold cursor-pointer">How do I reset my password?</summary>
            <p className="mt-2 text-gray-700">
              Click on "Forgot Password" at the login page and follow the instructions to reset your password.
            </p>
          </details>
          <details className="bg-blue-50 rounded-2xl p-4 shadow-inner">
            <summary className="font-semibold cursor-pointer">How can I apply for a job?</summary>
            <p className="mt-2 text-gray-700">
              Browse jobs on the landing page, click on a job, and hit "Apply Now" to submit your application.
            </p>
          </details>
          <details className="bg-blue-50 rounded-2xl p-4 shadow-inner">
            <summary className="font-semibold cursor-pointer">How do I post a job as an employer?</summary>
            <p className="mt-2 text-gray-700">
              After logging in as an employer, navigate to the "Add Job" page and fill out the job posting form.
            </p>
          </details>
        </motion.div>
      </section>
    </div>
  );
};

export default SupportPage;
